import React from "react";

const About = () => {
  return (
    <section id="about">
      <div class="container">
        <div class="row">
          <div class="col-md-6 text-center">
            <h3>About Us</h3>
            <p>Indonesia merupakan penghasil sampah plastik laut terbesar kedua di dunia. Sifat sampah plastik yang tidak mudah di urai secara alami menimbulkan toksit (racun) dan bersifat karsinogenik yang dapat menimbulkan sel kanker.</p>
          </div>
          <div class="col-md-6">
            <p>
              Sebagai kontribusi mengurangi sampah plastik, kami membuat website ini, juga dengan keinginan memotivasi masyarakat khususnya Madiun agar bisa menjadi pribadi yang kreatif dan inovatif. Karya yang sudah dibuat nantinya bisa
              jual untuk menambah penghasilan di masa pandemi saat ini
            </p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
